import {Route, Switch} from 'react-router-dom';
import Signup from './signup.js';
import Login from './login.js';
const App=()=>{
    return (
        <Switch>
            <Route path="/" />
            <Route path="/login" component={Login} />
            <Route path="/sighup" component={Signup} />
       </Switch>
    );
}
export default App;
